/**
 * Unwraps possible function calls and returns the value. It will return the value if the given
 * argument is not a function.
 */
export declare function unwrap<T>(fn: T): T extends () => any ? ReturnType<T> : T;
/**
 * Recursively unwraps possible function calls and returns the final value. It will return
 * the value if the given argument is not a function.
 */
export declare function unwrapDeep<T>(fn: T): DeepReturnType<T>;
export type DeepReturnType<T> = T extends () => any ? ReturnType<T> extends () => any ? DeepReturnType<ReturnType<T>> : ReturnType<T> : T;
